import { Typography } from "@mui/material";
import PostComponent from "../components/posts/PostComponent";

const PostPageOne = () => {
  return (
    <div>
      <Button variant="outlined" sx={{ mb: 4 }} onClick={handleClick}>
        Home
      </Button>
      <Typography variant="h2" sx={{ mb: 2 }}>
        One Post
      </Typography>
      <PostComponent />
    </div>
  );
};

export default PostPageOne;
